import React from 'react'
import {ListItem, ListItemText, Avatar } from '@material-ui/core'
const Incredients = ({item}) => {
    return (
        <div className="incredient">
            <ListItem>
                <Avatar>
                    {item.amount}
                </Avatar>
                <ListItemText>
                    {item.name}
                </ListItemText>
            </ListItem>

            {/* <li><span>{item.amount} {item.unit}</span>{item.name}</li> */}

        </div>
    )
}

export default Incredients
